WrongCondition: sp.michelson("
            DUP;
            SIZE;
            DUP 3;
            SIZE;
            SWAP;
            PAIR;
            DUP;
            UNPAIR;
            COMPARE;
            GE;
            IF
            {
                UNPAIR;
                DUP 2;
                SWAP;
                SUB;
                ABS; # ABS is secure here because we already validated that (text length is greater or equal to postfix)
                SLICE;
                IF_NONE
                {
                    DROP;
                    PUSH bool False;
                }
                {
                    COMPARE;
                    EQ;
                };
            }
            {
                DROP 3;
                PUSH bool False;
            };
            ")('abc', 'c') == True

